import React from "react";
// Component
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
// Icons
import {faMusic} from "@fortawesome/free-solid-svg-icons";


const Nav = () => {
    return (
        <nav>
            <h1>Waves</h1>
            <button>
                Library
                <FontAwesomeIcon icon={faMusic} />
            </button>
        </nav>
    )
}
